import React,{Component} from 'react';
import logo from '../itachi.jpg';
import '../App.css';
import {Link} from "react-router-dom";


export class Welcome extends Component {

  constructor(props){
    super(props);
    this.state={apiResponse:""};
  }
  callAPI(){
    fetch("http://localhost:8800/test").then(res => res.text()).then(res => this.setState({apiResponse: res}))
  }
  componentWillMount(){
    this.callAPI();
  }

render(){


    return (
        <div>
        <header className="App-header">
        <div className="FormField pb-5">
          <button onClick={this.send} className="FormField__Button mr-20">M'inscrire</button> <Link to="/login" className="FormField__Link">Je suis déjà un utilisateur</Link>
        </div>
        <p> Je suis itachi uchiwa </p>
          <img src={logo}  alt="itachi" />

        </header>
        <p> {this.state.apiResponse} </p>
        </div>
        );
    }
}
